sys_variable_value.value:
(function execute(inputs, outputs) {
   var gr = new GlideRecord('sc_cat_item');
   gr.addQuery('sys_id', inputs.cata_item);
   gr.query();
   if (gr.next()) {
      gr.deleteRecord();
   }
})(inputs, outputs);

